import Jumbotron from 'react-bootstrap/Jumbotron'
import 'bootstrap/dist/css/bootstrap.min.css'
import ReactuseState, {useState, useEffect} from 'react'
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Button from 'react-bootstrap/Button'
import List from './components/List'
import Editor from './components/Editor'
import * as N from './utils/noteHelpers'
import Form from './examples/Form'
import Clock from './examples/Clock'
import {getNotes} from './utils/noteHelpers'

/* <ul>
    {getNote.map((note) => (
    <li>{note}</li>
    ))}
    </ul>
*/
//const list = notes.map((note) => <li>{note}</li>)

function App() {
  const [selectedNote, setSelectedNote] = useState(undefined)
  const [notes, setNotes] = useState([])

  useEffect(() => {
    const notes = getNotes()
    setNotes(notes)
  }, [setNotes])

  const refreshList = () => {
    const notes = getNotes()
    setNotes([...notes])
  }

  return (
    <Container>
      <Jumbotron fluid>
        <Container>
          <h1>Notes by Angelica</h1>
          <p>Här är min note app!</p>
        </Container>
      </Jumbotron>
      <Row>
        <Col sm={4}>
          <>
            <Button variant="dark" size="md" block className="mb-4">
              New note
            </Button>
          </>
          <List notes={notes} selectedNote={selectedNote} setSelectedNote={setSelectedNote} />
        </Col>
        <Col>
          {/*<Editor />*/}
          <Form refreshList={refreshList} selectedNote={selectedNote} />
          {/*<Clock /> */}
        </Col>
      </Row>
    </Container>
  )
}

// getNote(3)

export default App
